import SearchBar from './components/SearchBar';

class App {
  constructor() {
    this.state = {
      city: '',
    };
    this.SearchBar = new SearchBar;
  }

  render() {
    document.getElementById('root').appendChild(this.SearchBar.render());
  }
};

export default App;
